SELECT d_items.label, DENSE_RANK() OVER (ORDER BY COUNT(*) DESC) AS rank FROM d_items WHERE d_items.itemid IN (
    SELECT outputevents.itemid FROM outputevents WHERE datetime(outputevents.charttime) >= datetime(current_time, '-1 year') GROUP BY outputevents.itemid
) LIMIT 4
